import React from "react";
import {NavLink} from "react-router-dom";
import logo from '../assets/logo.png';

import Navbar from "./Navbar";

function Header () {
    return (
        <header>
            <Link to="/"><img src={logo} alt="thifty logo" className="logo" /></Link>
            <Nav /> 
        </header>

    )
}
